import React, { Component } from 'react';
import FileA from './FileA'
import { Provider } from './Context'


class App extends Component {
    
    render() { 
        return (
            <Provider value="Hello Everyone">
                <FileA />
            </Provider>
        );
    }
}
 
export default App;
